import * as React from 'react';
import styles from './Button.module.scss';

type ButtonProps = {
  backgroundFull: boolean;
  text: string;
}

const Button = ({ backgroundFull, text }: ButtonProps) => (
  <button
    type="button"
    className={backgroundFull ? styles.fullButton : styles.emptyButton}
  >
    {text}
  </button>
);

export default Button;
